import { Box,styled } from '@mui/system'
import React from 'react'
import {navData} from '../Constants/data'

const Component = styled(Box)`
display:flex
`;

const Navbar = () => {
  return (
   <Component>
    {
            navData.map(data =>(
                <Box>
                    <img src={data.url} alt="nav"/>
                    <p>{data.text}</p>
                </Box>
            ))
    }
   </Component>
    )
}

export default Navbar
